function Movie({title, coverImg, genres, summary}) {
  return (
    <li>
        <h2>{title}</h2>
        <img src={coverImg} alt="cover img"/>
        <ul>
          {genres.map(g => <li key={g}>{g}</li>)}
        </ul>
        <p>{summary}</p>
      </li>
    
  )
}

export default Movie;
